query:
/*+ NoNestLoop(t ci) NoNestLoop(ci t mk) */ select count(*)
from title AS t
inner join cast_info AS ci
on t.id = ci.movie_id AND t.kind_id = 7 AND t.production_year < 2011 AND ci.person_id < 1694896 AND ci.role_id = 3
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id > 22484;
